<script>

    function socialresponse()
    {
        var str = document.getElementById('provider').value;
        if(str == 'facebook'){
            document.getElementById('socialfb').style.display="block";
            document.getElementById('socialgoogle').style.display="none";
            document.getElementById('socialfb').removeAttribute('disabled');
            document.getElementById('socialgoogle').setAttribute('disabled',true);
        }
         if(str=='google'){
            document.getElementById('socialfb').style.display="none";
            document.getElementById('socialgoogle').style.display="block";                   
            document.getElementById('socialgoogle').removeAttribute('disabled');
            document.getElementById('socialfb').setAttribute('disabled',true);
        }
    }
    </script>
